import React from "react";

function MobileGames() {
  return (
    <div>
      <div className="flex items-center justify-between px-10 text-white">
        <h4>Andriod Games</h4>
        <h4 className="cursor-pointer text-4xl font-semibold text-green-400">
          SEE MORE
          <img
            className="ml-3 inline-block w-5 -rotate-90"
            style={{ filter: "invert(100%)" }}
            src="/assets/icons/angle-down.svg"
            alt="see more"
          />
        </h4>
      </div>
    </div>
  );
}

export default MobileGames;
